#### Definitions

**1**   In this Act:

**"authorized person"** means a person authorized by an occupier of premises to exercise a power or perform a duty of the occupier under this Act;

**"enclosed land"** includes land that is

(a) surrounded by a lawful fence,

(b) surrounded by a natural boundary,

(c) surrounded by a lawful fence and a natural boundary, or

(d) posted, in accordance with section 4 (1) *[methods of posting or giving notice]*, with signs prohibiting trespass;

**"lawful fence"** means a lawful fence as defined by regulation;

**"occupier"**, in relation to premises, means the following:

(a) in the case of premises that are

(i)  land, including enclosed land, foreshore and land covered by water, or

(ii)  property described in paragraph (b) (i) of the definition of "premises",

a person entitled to maintain an action for trespass in respect of those premises;

(b) in the case of premises that are property described in paragraph (b) (ii) or (iii) of the definition of "premises", a person lawfully entitled to possession of those premises;

(c) in the case of premises that are water, a person described in paragraph (a) of this definition in relation to the land under the water;

(d) in any case, a person who has

(i)  responsibility for and control over the condition of the premises or the activities carried out on or in the premises, or

(ii)  control over persons allowed to enter the premises;

**"owner"**, in relation to land, means a person registered in the land title office as the owner of the estate in fee simple of the land;

**"premises"** means

(a) land, including

(i)  enclosed land, and

(ii)  foreshore and land covered by water, and

(b) anything on the land, including

(i)  a building or other permanent structure, including a building or permanent structure designed or used for shelter for livestock,

(ii)  a ship or vessel, train, railway car, vehicle or aircraft, except while in operation,

(iii)  a trailer or a portable structure designed or used as a residence, for shelter, including shelter for livestock, or to house a business, and

(iv)  water;

**"vehicle"** has the same meaning as in the [*Motor Vehicle Act*](https://www.bclaws.gov.bc.ca/civix/document/id/complete/statreg/96318_00).

#### Power to make regulations

**12**   (1) The Lieutenant Governor in Council may make regulations referred to in section 41 *[powers to make regulations]* of the [*Interpretation Act*](https://www.bclaws.gov.bc.ca/civix/document/id/complete/statreg/96238_01).

(2) Without limiting subsection (1), the Lieutenant Governor in Council may, by regulation, do one or more of the following:

(a) define a lawful fence for the purposes of this Act in the area described in the regulation;

(b) define a lawful fence for the purpose of dividing the right of way, grounds or property of a railway company to which the [*Railway Act*](https://www.bclaws.gov.bc.ca/civix/document/id/complete/statreg/96395_01) applies from other land, whether belonging to the railway company or not;

(c) define a lawful fence for the purpose of protecting any stack of hay or grain.
